import React, { useState, useEffect } from "react";
import axios from "axios";
import youtube from "./api/youtube";

// console.log(process.env.REACT_APP_YOUTUBE_API_KEY)
// https://youtube.googleapis.com/youtube/v3/channels?part=snippet%2CcontentDetails%2Cstatistics&id=UCu2YhywZvs7pXUEL3RCUEaA&key=AIzaSyAbnlDjtTzRH0MXRtdWapejsD5V0yzKLS0
// Channel Id = UCu2YhywZvs7pXUEL3RCUEaA
// API key = AIzaSyAbnlDjtTzRH0MXRtdWapejsD5V0yzKLS0

const Videos = ({ videos }) => {
  if (videos.length === 1) {
    return (
      <div>
        <ul>
          {videos.map((video) => (
            <li key={video.id.videoId}>{video.snippet.title}</li>
          ))}
        </ul>
      </div>
    );
  }

  return (
    <div>
      <ul>
        {videos.map((video) => (
          <li key={video.id.videoId}>{video.snippet.title}</li>
        ))}
      </ul>
    </div>
  );
};

const App = () => {
  const [videos, setVideos] = useState([]);
  const [videoFilter, setVideoFilter] = useState("");

  const handleChange = (event) => {
    console.log(event.target.value);
    setVideoFilter(event.target.value);
  };

  const videosToShow = videoFilter
    ? videos.filter((video) =>
        video.snippet.title.toLowerCase().includes(videoFilter.toLowerCase())
      )
    : videos;

  useEffect(() => {
    axios
      .get(
        // `https://www.googleapis.com/youtube/v3/search?key=${process.env.REACT_APP_YOUTUBE_API_KEY}&channelId=UCu2YhywZvs7pXUEL3RCUEaA&part=snippet,id&order=date&maxResults=50`
        `https://www.googleapis.com/youtube/v3/search?order=date&part=snippet&channelId=UCu2YhywZvs7pXUEL3RCUEaA&maxResults=25&key=${process.env.REACT_APP_YOUTUBE_API_KEY}`
      )
      .then((response) => {
        setVideos(response.data['items'].id.kind.video);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  console.log("render", videos.length, "videos");
  console.log(videos);

  return (
    <div>
      <input value={videoFilter} onChange={handleChange} />
      <Videos videos={videosToShow} />
    </div>
  );
};

export default App;
